import React from 'react'
import styled from 'styled-components';

const Input = styled.input`
  width: 343px;
  height: 48px;
  background: #FFFFF;
  border-radius: 6px;
  border-color: #C1C1C1;
`;

class EmailField extends React.Component{
    render(){
        return(
        <div>
            <Input type="email" href=""/>
        </div>
        )
    }
}

export default EmailField;
